      SELECT ALL 11 * + 70 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + + 4 < col0 OR NOT col1 <= col2 * + ( 24 ) / - 23 * col2 - - - 72;
  - name: tab0

outputs:
